import React, {Component} from 'react';
import { Link } from 'react-router-dom'
import './Navbar.css'
//COULD ADD LIKE DIFFERENT AVATARS TO CHOOSE FROM 

export class Navbar extends Component{
    render(){
        return(
            <div>
                <ul className = 'Navbar'>
                    <li><Link to='/'>My Habits</Link></li>
                    <li><Link to='/'>My Habits</Link></li>
                    <li><Link to='/'>My Habits</Link></li>
                </ul>
            </div>
        ) 
    }
}
